import React from 'react';
import {
  GoogleMap,
  withScriptjs,
  withGoogleMap,
  Polygon
} from 'react-google-maps';
import { Drawer } from 'antd';
import axios from 'axios';

let key = 0;
let key2 = 0;

function Map({
  closeDrawer,
  openDrawer,
  currentDrawerState,
  mapPolygons,
  drawerInfos,
  center
}) {
  //console.log(center);
  // console.log(drawerInfos);

  //console.log(mapPolygons)
  //console.log(drawerInfos)
  //console.log(drawerInfos.img);
  //console.log(drawerInfos.services)

  return (
    <GoogleMap
      defaultZoom={17}
      // center={center}
      defaultCenter={{ lat: 37.3352, lng: -121.8811 }}
      // center={{lat: 37.272040, lng: -121.861260}}
      options={{
        styles: [
          {
            elementType: 'labels',
            featureType: 'poi.business',
            stylers: [{ visibility: 'off' }]
          }
        ]
      }}
    >
      <div>
        {mapPolygons.map(mapPolygon => (
          <div key={key++}> {mapPolygon} </div>
        ))}
      </div>

      <Drawer
        className='drawer'
        title={drawerInfos.desc}
        placement='left'
        closable={true}
        onClose={closeDrawer}
        visible={currentDrawerState}
      >
        {/* <h4>Charles W. Davidson College of Engineering</h4> */}
        {/* <img src={require(`${ drawerInfos.img }`)}></img> */}
        <p>{drawerInfos.desc}</p>
        {/* <div>
           {drawerInfos.services.map(service => <li key={key2++}> {service} </li>)}
       </div> */}
      </Drawer>
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

export default WrappedMap;
